import React from 'react';
import Slider from './Slider';
import Services from './Services';
import '../styles/about.css';

const About = () => {
  return (
    <div className="about-container">
      <div className="card">
        <h1>About Sweet Cake</h1>
        <Slider />
        <div className="about-text">
          <p>Welcome to Sweet Cake, your number one source for all things sweet and delightful. We're dedicated to giving you the very best of cakes, with a focus on quality, customer service, and uniqueness.</p>
          <p>Founded in 2024 by Jane Doe, Sweet Cake has come a long way from its beginnings in a home kitchen. When Jane first started out, her passion for baking drove her to quit her day job, and gave her the impetus to turn hard work and inspiration into a booming online store. We now serve customers all over the country and are thrilled to be a part of the eco-friendly, fair trade wing of the baking industry.</p>
          <p>We hope you enjoy our products as much as we enjoy offering them to you. If you have any questions or comments, please don't hesitate to contact us.</p>
          <p>Sincerely,</p>
          <p>Ikram Bachar, Founder</p>
        </div>
      </div>
      <h2>Our Services</h2>
      <Services />
    </div>
  );
};

export default About;
